description:
Looking to raise money for her trip to Germany, teen Lizz is shocked when she receives a very large donation. Tiny teen Amai seems to have all the right answers in class, but does she have what it takes to be the teacher's pet? After a horrible driving lesson, teen Heather hopes she has better luck riding her instructor's stick. Tasha can't afford to fail her final exam and she's ready to risk it all to make sure she gets a passing grade. Mischievous teen Lily has a little crush on her friend's dad and she'll do anything to get his attention.

Amai Liu, Lizz Tayler, Lily Carter, Heather Scarlet, Tasha Reign

